import { createMuiTheme } from '@material-ui/core/styles';
import { orange } from '@material-ui/core/colors'

const theme = createMuiTheme({
  palette: {
    primary: {
      main: "#D4AF37",
      contrastText: "#fff"
    },
    background: {
      default: {
        background: "#FAFFCC"
      }
    }
  },
})

export default theme;
